import React from "react";
import { Routes, Route } from "react-router-dom";

import Navbar from "";
import './App.css';
import AllArticles from "./pages/AllArticles";
import NewArticles from "./pages/NewArticles";

function App() {
  return (
    <div>
      <div>
        <Navbar />

        <Routes>
          <Route exact path="/" element={<AllArticles/>} />
          <Route exact path="/allarticles" element={<AllArticles />} />
          <Route exact path="/newarticles" element={<NewArticles />} />
        </Routes>
      </div>
    </div>
  );

}

export default App;
